import React from 'react';
import './Header.css';

function Header() {
    return (
        <header>
            <figure>
                <img src="/public/logo192.png" alt="parchment icon" style="width:100%" />
            </figure>
            <h1>Archivist</h1>
            <h2>
                A Character Leveling Companion App<br />
                for Dungeons & Dragons 5th Edition
            </h2>
        </header>
    );
}

export default Header;
